package assets

import (
	"archive/zip"
	"bytes"
	"encoding/base64"
	"net/http"

	"golang.org/x/tools/godoc/vfs"
	"golang.org/x/tools/godoc/vfs/httpfs"
	"golang.org/x/tools/godoc/vfs/zipfs"
)

func NewZippedFilesFS() vfs.FileSystem {
	decodedData, err := base64.StdEncoding.DecodeString(ZippedFiles)
	if err != nil {
		panic(err)
	}

	zipReader, err := zip.NewReader(bytes.NewReader(decodedData), int64(len(ZippedFiles)))
	if err != nil {
		panic(err)
	}

	return zipfs.New(&zip.ReadCloser{Reader: *zipReader}, "/")
}

func NewZippedFilesHttpFS() http.FileSystem {
	return httpfs.New(NewZippedFilesFS())
}

const ZippedFiles = ``
